import React from "react";

export default function APITable() {
	function getAPIAsync() {
		return fetch('/api/employees/')
		.then((response) => response.json())
		.then((responseJson) => {
		return responseJson.movies;
		})
		.catch((error) => {
			console.error(error);
		});
	}
	console.log(getAPIAsync);
	
}
